function ProductPage() {
	return (
		<div className='mt-8'>
			<span className='font-bold ml-[50px] mt-[20px] text-[30px]'>Product</span>
			<div className='grid grid-cols-4 shadow-md container mx-auto'>
				<div className='rounded-lg mt-[10px] border border-red-500 w-[250px] shadow'>
					<img src='pawz_road_cat_sleeping_bag_self_warming_kitty_sack_1_346x346_crop_center.jpeg'></img>
					<div className='p-[10px]'>
						<a className=''>
							Pawz Road Cat Sleeping Bag Self Warming Kitty Sack
						</a>
						<br></br>
						<span className='text-yellow-300 ml-2'>$50.00</span>
					</div>
					<button className='block bg-yellow-400 hover:bg-yellow-300 text-white font-bold py-2 px-4 rounded mt-[5px] mx-auto'>
						Add to cart
					</button>
				</div>
			</div>
		</div>
	);
}

export default ProductPage;
